//SPDX-License-Identifier: GPL-3.0
pragma solidity >= 0.8.0 <= 0.8.3;

contract Auction {
    address public highestBidder; // The highest bidder's address
    uint public highestBid; // The amount of the highest bid
    mapping(address => uint) public userBalances; // mapping for the amount to return 
    //uint256 constant WITHDRAW_INTERVAL=10 seconds;
    address payable owner;

    constructor(){
        // contractor
        // 1. Initialize highest bid and the bidder's address
        highestBid=0;
        highestBidder=msg.sender;
        owner=payable(msg.sender);
    }


    modifier notOwner(){
        require(msg.sender!=owner,"OWNER CANNOT BID");
        _;
    }

    modifier notHighestBidder(){
        require(msg.sender!=highestBidder,"HIGHEST BIDDER CANNOT TAKE BACK THE OFFER");
        _;
    }

    function bid() public payable notOwner{
    // Function to process bid
    // 1. Check if the bid is greater than the current highest bid
    // 2. Update status variable and the amount to return

        require(highestBid<msg.value,"OFFER MUST BE HIGHER THAN THE HIGHEST BID");

        highestBidder=msg.sender;
        highestBid=msg.value;


        if(msg.value>userBalances[msg.sender]){
                require(payable(msg.sender).send(userBalances[msg.sender]),"NOT ENOUGH ETH ON CONTRACT"); 
        }

        userBalances[msg.sender]=msg.value;
    }

    function withdraw() public notHighestBidder{


        uint amount = userBalances[msg.sender];
        if (amount > 0) {
            // It is important to set this to zero because the recipient
            // can call this function again as part of the receiving call
            // before send returns.
            userBalances[msg.sender] = 0;

            if (!payable(msg.sender).send(amount)) {
                // No need to call throw here, just reset the amount owing
                userBalances[msg.sender] = amount;

            }
        }

    }

    function getContractBalance() public view returns(uint){

        return(address(this).balance);
    }
}
